import React , { useState } from 'react';

function App(){

  const MyColor = "blue";
  const [scolor, setcolor] = useState(MyColor);

  function Mouseclick(){
    let updatecolor = "Yellow";
    setcolor(updatecolor);
  }

  return(
    <>
    <div style={ { backgroundColor : scolor } }>
      <button >Click Me</button>
    </div>
    </>
  )
}

export default App;
